export const CONSULTORIO = "consultorio/CONSULTORIO";

export const types = {
    CONSULTORIO_REQUEST: `${CONSULTORIO}_REQUEST`,
    CONSULTORIO_SUCCESS: `${CONSULTORIO}_SUCCESS`,
    CONSULTORIO_ERROR: `${CONSULTORIO}_ERROR`,

    CONSULTORIO_ALTA_MEDICO_REQUEST: `${CONSULTORIO}_ALTA_MEDICO_REQUEST`,
    CONSULTORIO_ALTA_MEDICO_SUCCESS: `${CONSULTORIO}_ALTA_MEDICO_SUCCESS`,
    CONSULTORIO_ALTA_MEDICO_ERROR: `${CONSULTORIO}_ALTA_MEDICO_ERROR`,
};

export const INITIAL_STATE = {
    fetching: false,
};
export default (state = INITIAL_STATE, action = {}) => {
    switch (action.type) {
        case types.CONSULTORIO_REQUEST:
            return {
                ...state,
                fetching: true,
            };
        case types.CONSULTORIO_SUCCESS:
            return {
                ...state,
                fetching: false,
            };
        case types.CONSULTORIO_ERROR:
            return {
                ...state,
                fetching: false,
            };

            case types.CONSULTORIO_ALTA_MEDICO_REQUEST:
            return {
                ...state,
                fetching: true,
            };
        case types.CONSULTORIO_ALTA_MEDICO_SUCCESS:
            return {
                ...state,
                fetching: false,
            };
        case types.CONSULTORIO_ALTA_MEDICO_ERROR:
            return {
                ...state,
                fetching: false,
            };

        default:
            return state;
    }
};

export const actions = {
    listconsultorioReq: (setList) => ({
        type: types.CONSULTORIO_REQUEST,
        setList,
    }),
    listconsultorioSuccess: () => ({
        type: types.CONSULTORIO_SUCCESS,
    }),
    listconsultorioError: () => ({
        type: types.CONSULTORIO_ERROR,
    }),

    altaMedicoSendRequest: (medico) => ({
        type: types.CONSULTORIO_ALTA_MEDICO_REQUEST,
        medico,
    }),
    altaMedicoSuccess: () => ({
        type: types.CONSULTORIO_ALTA_MEDICO_SUCCESS,
    }),
    altaMedicoError: () => ({
        type: types.CONSULTORIO_ALTA_MEDICO_ERROR,
    }),
};

export const selectors = {
    isFetching: ({ consultorio }) => consultorio.consultorio.fetching,
};


export const altaMedicoRequest = (data) => {
    actions.altaMedicoSendRequest(data)
    const user = {
        nombre: 'John',
        appellido: 'Lilly',
        celular: '11220093'
    };

    const options = {
        method: 'POST',
        body: JSON.stringify(user),
        headers: {
            'Content-Type': 'application/json'
        }
    }

    fetch('https://localhost:8080/users/altaMedico', options)
        .then(res =>{ 
            actions.altaMedicoSuccess()


            res.json()})
        .then(res => {
            actions.altaMedicoError()

            console.log(res)});


}
